DROP TABLE IF EXISTS `jsj_user`;
CREATE TABLE `jsj_user` (
  `id` int(11) NOT NULL auto_increment,
  `account` varchar(50) default NULL COMMENT '账号',
  `name` varchar(50) default NULL COMMENT '姓名',
  `pwd` varchar(64) default NULL,
  `invite_id` int(20) default NULL COMMENT '邀请人id',
  `head_img` varchar(255) default NULL,
  `phone` varchar(50) default NULL,
  `email` varchar(100) default NULL,
  `school` varchar(50) default NULL COMMENT '学校id',
  `gender` varchar(10) default NULL COMMENT '性别',
  `sign` varchar(255) default NULL COMMENT '签名',
  `collect_type` varchar(50) default NULL COMMENT '收款账号类型',
  `collect_account` varchar(50) default NULL COMMENT '收款账号',
  `collect_name` varchar(50) default NULL COMMENT '收款账号名',
  `addr_name` varchar(50) default NULL COMMENT '收货人姓名',
  `addr_phone` varchar(50) default NULL COMMENT '收货电话',
  `addr_post` varchar(50) default NULL COMMENT '收货邮编',
  `addr_province` varchar(50) default NULL,
  `addr_desc` varchar(255) default NULL COMMENT '收货地址',
  `reg_time` timestamp NULL default CURRENT_TIMESTAMP COMMENT '注册时间',
  `last_login_time` timestamp NULL default NULL COMMENT '最后登录时间',
  `invite_name` varchar(255) default NULL,
  PRIMARY KEY  (`id`)
